import React, { useEffect, useState } from "react";
import Tree from "react-d3-tree"; // or another visualization library
import axios from "axios";

const ClusteringTreeComponent = ({ subspaceId }) => {
  const [treeData, setTreeData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchClusteringTree = async () => {
      try {
        const response = await axios.get(
          `http://localhost:5000/hierarchy_cluster`, // Update with your actual endpoint
          { params: { sub_ind: subspaceId } }
        );
        setTreeData(response.data);
      } catch (err) {
        setError("Failed to fetch clustering tree.");
      } finally {
        setLoading(false);
      }
    };

    fetchClusteringTree();
  }, [subspaceId]);

  if (loading) return <p>Loading Clustering Tree...</p>;
  if (error) return <p>Error: {error}</p>;

  return (
    <div style={{ width: "100%", height: "500px" }}>
      <h2>Clustering Tree</h2>
      <Tree data={treeData} orientation="vertical" />
    </div>
  );
};

export default ClusteringTreeComponent;
